column10:
Anything herein to the contrary notwithstanding, if, on or prior to the determination of LIBOR for any Interest Period:

 (a) the Administrative Agent shall determine (which determination shall be conclusive) that reasonable and adequate means do not exist for the ascertaining LIBOR for such Interest Period;

 (b) the Administrative Agent reasonably determines (which determination shall be conclusive) that quotations of interest rates for the relevant deposits referred to in the definition of LIBOR are not being provided in the relevant amounts or for the relevant maturities for purposes of determining rates of interest for LIBOR Loans as provided herein;

 (c) the Administrative Agent reasonably determines (which determination shall be conclusive) that the relevant rates of interest referred to in the definition of LIBOR upon the basis of which the rate of interest for LIBOR Loans for such Interest Period is to be determined are not likely to adequately cover the cost to any Lender of making or maintaining LIBOR Loans for such Interest Period; or

 (d) any Revolving Lender that has outstanding a Bid Rate Quote with respect to a LIBOR Margin Loan reasonably determines (which determination shall be conclusive) that LIBOR will not adequately and fairly reflect the cost to such Revolving Lender of making or maintaining such LIBOR Margin Loan;

then the Administrative Agent shall give the Borrower and each Lender prompt notice thereof and, so long as such condition remains in effect, (i) the Lenders shall be under no obligation to, and shall not, make additional LIBOR Loans, Continue LIBOR Loans or Convert Loans into LIBOR Loans and the Borrower shall, on the last day of each current Interest Period for each outstanding LIBOR Loan, either prepay such Loan or Convert such Loan into a Base Rate Loan and (ii) in the case of clause (d) above, no Revolving Lender that has outstanding a Bid Rate Quote with respect to a LIBOR Margin Loan shall be under any obligation to make such Loan.

Section 5.3.  Illegality.
 Notwithstanding any other provision of this Agreement, (a) if any Lender shall determine (which determination shall be conclusive and binding) that it is unlawful for such Lender to honor its obligation to make or maintain LIBOR Loans hereunder and/or (b) if any Lender that has an outstanding Bid Rate Quote shall determine (which determination shall be conclusive and binding) that it is unlawful for such Lender to honor its obligation to make or maintain LIBOR Margin Loans hereunder, then such Lender shall promptly notify the Borrower thereof (with a copy of such notice to the Administrative Agent) and such Lender’s obligation to make or Continue, or to Convert Loans of any other Type into, LIBOR Loans shall be suspended and/or such Lender’s obligation to make LIBOR Margin Loans shall be suspended, in each case, until such time as such Lender may again make and maintain LIBOR Loans or LIBOR Margin Loans (in which case the provisions of Section 5.5. shall be applicable).

